webpackJsonp([57151859537050],{703:function(A,e){A.exports={data:{post:{id:"C:/Users/dstevens/Dropbox/davidstevens/content/posts/2018-09-05--building-for-production-with-gatsby/index.md absPath of file >>> MarkdownRemark",html:'<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/pankaj-patel-js-302e29f1a49b1b35d73353978c745492-f107e.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 62.50451752800868%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="unsplash.com"\n        title=""\n        src="/static/pankaj-patel-js-302e29f1a49b1b35d73353978c745492-78f2b.jpg"\n        srcset="/static/pankaj-patel-js-302e29f1a49b1b35d73353978c745492-dce19.jpg 200w,\n/static/pankaj-patel-js-302e29f1a49b1b35d73353978c745492-c1413.jpg 400w,\n/static/pankaj-patel-js-302e29f1a49b1b35d73353978c745492-78f2b.jpg 800w,\n/static/pankaj-patel-js-302e29f1a49b1b35d73353978c745492-ab4c4.jpg 1200w,\n/static/pankaj-patel-js-302e29f1a49b1b35d73353978c745492-bc99b.jpg 1600w,\n/static/pankaj-patel-js-302e29f1a49b1b35d73353978c745492-34a60.jpg 2400w,\n/static/pankaj-patel-js-302e29f1a49b1b35d73353978c745492-f107e.jpg 5534w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>My Twitter feed typically spans from <a href="https://twitter.com/sehurlburt/status/1042557375171899392">soft skills</a>, <a href="https://mobile.twitter.com/levelsio/status/956176482958639105">startup culture</a>, <a href="https://twitter.com/feministy/status/986427827481464833">remote work</a>, to <a href="https://twitter.com/Nick_Craver/status/1046841014433005570">developer fury</a>, but I instantly reacted when I saw this tweet:</p>\n<blockquote>\n<blockquote class="twitter-tweet" data-lang="en"><p lang="en" dir="ltr">üå∂ Hot take: Using the to-do app as the Hello World was a big step back for teaching devs.<br><br>When the Twitter app was the Hello World, it taught everyone auth, associations, async requests, 3rd party APIs, offline, etc.</p>&mdash; Jonnie Hallman (@destroytoday) <a href="https://twitter.com/destroytoday/status/1024321627612426241?ref_src=twsrc%5Etfw">July 31, 2018</a></blockquote><br />\n</blockquote>\n<p>YES. ABSOLUTELY YES.</p>\n<p>Why does it feel like new app tutorials aren‚Äôt actually teaching me anything?  Where do I squeeze in professional development with earning my keep, pursuing healthy hobbies, and being present with family?</p>\n<p>Enter Gatsby.</p>\n<h1>What is Gatsby?</h1>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/dean-pugh-office-fd7664fbf95c0355cda4fe262aa4c80b-0c070.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="unsplash.com"\n        title=""\n        src="/static/dean-pugh-office-fd7664fbf95c0355cda4fe262aa4c80b-78f2b.jpg"\n        srcset="/static/dean-pugh-office-fd7664fbf95c0355cda4fe262aa4c80b-dce19.jpg 200w,\n/static/dean-pugh-office-fd7664fbf95c0355cda4fe262aa4c80b-c1413.jpg 400w,\n/static/dean-pugh-office-fd7664fbf95c0355cda4fe262aa4c80b-78f2b.jpg 800w,\n/static/dean-pugh-office-fd7664fbf95c0355cda4fe262aa4c80b-ab4c4.jpg 1200w,\n/static/dean-pugh-office-fd7664fbf95c0355cda4fe262aa4c80b-bc99b.jpg 1600w,\n/static/dean-pugh-office-fd7664fbf95c0355cda4fe262aa4c80b-34a60.jpg 2400w,\n/static/dean-pugh-office-fd7664fbf95c0355cda4fe262aa4c80b-0c070.jpg 5472w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Imagine you‚Äôre the newly hired junior associate of tech recruiting.  Your client asked for a rockstar developer but you know nothing, so you Google ‚Äúweb development‚Äù.   Nothing useful there except a dated Wikipedia entry.  How about ‚Äúmodern web development‚Äù?  </p>\n<p>Ok, now you‚Äôre looking for someone who knows a few things: advanced CSS, a JavaScript framework (not jQuery), API interactions, performance optimization‚Ä¶  </p>\n<p>What if you, the (aspiring/junior/mid/senior) developer, don‚Äôt know all those things?  </p>\n<p><a href="https://www.gatsbyjs.org/">Gatsby</a> is a modern development framework that includes all the above:</p>\n<p>‚úÖ Javascript (React)<br>\n‚úÖ Prebuilt CSS (CSS-in-JS)<br>\n‚úÖ API reusability (GraphQL)<br>\n‚úÖ Blazing performance (Webpack/PWA)  </p>\n<h1>Why Gatsby?</h1>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/campbell-boulanger-porsche-0e7ff6d71dae2ddd599e9a7631c59a31-8a0ff.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 800px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.67565381504448%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px transparent;"\n        alt="unsplash.com"\n        title=""\n        src="/static/campbell-boulanger-porsche-0e7ff6d71dae2ddd599e9a7631c59a31-78f2b.jpg"\n        srcset="/static/campbell-boulanger-porsche-0e7ff6d71dae2ddd599e9a7631c59a31-dce19.jpg 200w,\n/static/campbell-boulanger-porsche-0e7ff6d71dae2ddd599e9a7631c59a31-c1413.jpg 400w,\n/static/campbell-boulanger-porsche-0e7ff6d71dae2ddd599e9a7631c59a31-78f2b.jpg 800w,\n/static/campbell-boulanger-porsche-0e7ff6d71dae2ddd599e9a7631c59a31-ab4c4.jpg 1200w,\n/static/campbell-boulanger-porsche-0e7ff6d71dae2ddd599e9a7631c59a31-bc99b.jpg 1600w,\n/static/campbell-boulanger-porsche-0e7ff6d71dae2ddd599e9a7631c59a31-34a60.jpg 2400w,\n/static/campbell-boulanger-porsche-0e7ff6d71dae2ddd599e9a7631c59a31-8a0ff.jpg 3709w"\n        sizes="(max-width: 800px) 100vw, 800px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>I‚Äôm not a JS junkie who only uses frameworks baked in the last 6 months.  I‚Äôve paid dues at both the mouth of node_modules and DLL hell, so if you tell me to try something new, it better be worth it.  Why couldn‚Äôt you just learn all those topics on your own?</p>\n<p>Here‚Äôs my pitch:</p>\n<p>Gatsby starts with what you need to know, polishes what you think you know, and puts everything else under the hood.</p>\n<p>Prefer to drive at a slower pace?  <a href="https://www.gatsbyjs.org/tutorial/">This</a> is for you.</p>\n<p>Prefer to jump right in and go?  <a href="https://www.gatsbyjs.org/starters/">That</a> is for you.</p>\n<p>Prefer to stop using vague car metaphors?  <a href="https://i.giphy.com/media/7K3p2z8Hh9QOI/giphy.webp">Me too</a>.</p>\n<p>Gatsby‚Äôs components are well-documented and easy to read, and the entire source for the project is on <a href="https://github.com/gatsbyjs/gatsby">Github</a>.  Bravo to the team for making it so accessible.</p>\n<h1>Fin</h1>\n<p>If you hadn‚Äôt already guessed, this site is built with ‚ù§Ô∏èGatsby.</p>\n<p><em>Next</em>: I‚Äôll share some setup issues, added functionality, and thoughts for future improvement!</p>',fields:{slug:"/building-for-production-with-gatsby/",prefix:"2018-09-05"},frontmatter:{title:"Building For Production With Gatsby, Part 1",author:"david stevens",category:"development",cover:{childImageSharp:{resize:{src:"/static/pankaj-patel-js-302e29f1a49b1b35d73353978c745492-ada8c.jpg"}}}}},authornote:{id:"C:/Users/dstevens/Dropbox/davidstevens/content/parts/author.md absPath of file >>> MarkdownRemark",html:"<p><em><strong>David Stevens</strong> is a senior developer with a decade‚Äôs worth of mistakes and problem solving to show for it.  He loves finding ways to be more efficient, doing things with intensity, and sleeping outdoors.  You can find him here and on Twitter, except when he‚Äôs spending time with his wife and daughter.</em></p>"},site:{siteMetadata:{facebook:{appId:""}}}},pathContext:{slug:"/building-for-production-with-gatsby/",prev:{id:"C:/Users/dstevens/Dropbox/davidstevens/content/posts/2018-07-24--remote-setup/index.md absPath of file >>> MarkdownRemark",fields:{slug:"/remote-setup/",prefix:"2018-07-24"},frontmatter:{title:"Remote Life - The Setup",category:"remote"}}}}}});
